import React from "react";
import { connect } from "react-redux";
import $api from "../../../Http/index.js";
import CoursesAdmin from "./CoursesAdmin.jsx";
import { loading } from "../../../Redux/Reducers/loadingReducer.js";
import { isAuth } from "../../../Redux/Reducers/userReducer.js";
import Preloader from "../../../Assets/Preloader/PreloaderPage.jsx";
import { Redirect } from "react-router-dom";
import CoursesSteps from "./CoursesCreate/CoursesSteps.jsx";
class CoursesAdminContainer extends React.Component {
  componentDidMount() {
    this.props.loading(true);

    $api
      .get("/course/all")
      .then((response) => {
        console.log(response);
        this.props.loading(false);
        console.log("Vse zaebcom");
      })
      .catch((error) => {
        this.props.loading(false);
        console.log("user unauthorized");
        console.log(error);
      });
  }
  createCourse = (courseName) => {
    this.props.loading(true);
    $api
      .post("/admin/course/create", {
        courseName,
      })
      .then((response) => {
        return <CoursesSteps />;
      });
  };
  render() {
    return (
      <div>
        {this.props.state.isLoading.isLoading ? (
          <Preloader />
        ) : (
          <CoursesAdmin state={this.props.state} loading={this.props.loading} />
        )}
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    state: state,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    loading: (isLoading) => dispatch(loading(isLoading)),
    isAuth: (value) => dispatch(isAuth(value)),
  };
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(CoursesAdminContainer);
